import React from 'react';
import './App.scss';
import TopbarMain from './sections/Topbar/components/TopbarMain/TopbarMain';
import SidebarMain from './sections/Sidebar/components/SidebarMain/SidebarMain';
import FilterBar from './sections/Filterbar/components/FilterBar/FilterBar';
import GraphContainer from './sections/Graphs/components/GraphContainer/GraphContainer';


function App() {
  return (
    <div className="App">
      <TopbarMain/>
      <SidebarMain/>
      <FilterBar/>
      <GraphContainer/>
    </div>
  );
}

export default App;
